import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './adminHome.css';
import SocietyTable from '../table/societyTable';
import ManIcon from '@mui/icons-material/Man';
import ApartmentIcon from '@mui/icons-material/Apartment';
import { Link } from '@mui/material';

function AdminHome() {
    const [societiesCount, setSocietiesCount] = useState(0);

    useEffect(() => {
        // Fetch societies count when the component mounts
        fetchSocietiesCount();
    }, []);

    const fetchSocietiesCount = async () => {
        try {
            const response = await axios.get('http://localhost:9898/society/getAllSocietiesCount');
            setSocietiesCount(response.data.count);
        } catch (error) {
            console.error('Error fetching societies count:', error);
        }
    };

    return (
        <>
            <div className="home-container">
                <div className="card">
                    <h2>Societies</h2>
                    <p>{societiesCount}</p>
                </div>
                <div className="card">
                    <h2>Happy Families</h2>
                    <p>465</p>
                </div>

                <div className="sidebarMenu">
                    <h3 className="sidebarTitle">Society</h3>
                    <ul className="sidebarList">
                        <Link to="/registerSociety" className="link" style={{ textDecoration: 'none' }}>
                            <li className="sidebarListItem">
                                <ApartmentIcon/>
                                Register Society
                            </li>
                        </Link>
                    </ul>
                </div>

                <div className="sidebarMenu">
                        <h3 className="sidebarTitle">Secretary</h3>
                        <ul className="sidebarList">
                            <Link to="/registerSecretary" className="link" style={{ textDecoration: 'none' }}>
                                <li className="sidebarListItem">
                                    <ManIcon/>
                                    Register Secretary
                                </li>
                            </Link>
                        </ul>
                    </div>

                <div>



                </div>

            </div>
            <SocietyTable />
        </>
    );
}

export default AdminHome;
